var plPL={messages:{"'A Metamask error caused your wallet to disconnect. Reload the page to reconnect.'":"'A Metamask error caused your wallet to disconnect. Reload the page to reconnect.'","A signature is needed to trade this token on the Uniswap protocol. For security, signatures expire after 30 days.":"A signature is needed to trade this token on the Uniswap protocol. For security, signatures expire after 30 days.","Allow":"Dopuszczać","Allow in your wallet":"Pozwól w swoim portfelu","Allow {symbol} first":["Zezwól najpierw na ",["symbol"]],"Allowance pending":"Oczekiwanie na zasiłek","An error occurred when trying to execute this swap. You may need to increase your slippage tolerance. If that does not work, there may be an incompatibility with the token you are trading. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Wystąpił błąd podczas próby wykonania tej wymiany. Może być konieczne zwiększenie tolerancji na poślizg. Jeśli to nie zadziała, może występować niezgodność z tokenem, którym handlujesz. Uwaga: opłata za transfer i rebase tokeny są niezgodne z Uniswap V3.","Approval pending":"Oczekuje na zatwierdzenie","Approve":"Zatwierdź","Approve Permit2":"Approve Permit2","Approve in your wallet":"Zatwierdź w swoim portfelu","Approve {0} for trading":["Approve ",["0"]," for trading"],"Approve {symbol} first":["Najpierw zatwierdź ",["symbol"]],"Auto":"Auto","Auto Router":"Automatyczny router","Auto Router API":"Auto Router API","Balance:":"Saldo:","Best price route costs {0} in gas. Your price is optimized by considering split routes, multiple hops, and gas costs.":["Best price route costs ",["0"]," in gas. Your price is optimized by considering split routes, multiple hops, and gas costs."],"Cancel":"Cancel","Close":"Zamknij","Confirm in your wallet":"Potwierdź w swoim portfelu","Confirming approval":"Confirming approval","Connect to {0}":["Connect to ",["0"]],"Connect wallet":"Połącz portfel","Connecting…":"Łączenie…","Continue":"Continue","Convert {0} to {1}":["Konwertuj ",["0"]," na ",["1"]],"Convert {0} to {1} with no slippage":["Convert ",["0"]," to ",["1"]," with no slippage"],"Disconnect wallet":"Odłącz portfel","Dismiss":"Odrzuć","Enter an amount":"Wprowadź kwotę","Error fetching trade":"Błąd podczas pobierania transakcji","Exchange rate":"Exchange rate","Expected output":"Expected output","Fetching best price…":"Pobieranie najlepszej ceny…","Get support":"Get support","Gives you the ability to trade this token on the Uniswap protocol. For security, this will expire in 30 days.":"Gives you the ability to trade this token on the Uniswap protocol. For security, this will expire in 30 days.","High slippage increases the risk of price movement":"Wysoki poślizg zwiększa ryzyko zmiany ceny","I don't have a wallet":"nie mam portfela","Insufficient liquidity":"Insufficient liquidity","Insufficient {0} balance":["Niewystarczające saldo ",["0"]],"Invalid recipient":"Nieprawidłowy odbiorca","Max":"Maks.","Max slippage":"Maksymalny poślizg","Maximum input after slippage":"Maximum input after slippage","Minimum output after slippage":"Minimum output after slippage","Missing dependencies":"Brakujące zależności","Network fee":"Opłata sieciowa","No results found.":"Nie znaleziono wyników.","No tokens are available on this network. Please switch to another network.":"W tej sieci nie są dostępne żadne tokeny. Przełącz się na inną sieć.","Order routing":"Order routing","Output is estimated. You will receive at least {minReceivedString} or the transaction will revert.":["Output is estimated. You will receive at least ",["minReceivedString"]," or the transaction will revert."],"Output is estimated. You will send at most {maxSentString} or the transaction will revert.":["Output is estimated. You will send at most ",["maxSentString"]," or the transaction will revert."],"Permit2 allows safe sharing and management of token approvals across different smart contracts.":"Permit2 allows safe sharing and management of token approvals across different smart contracts.","Permit2 approval failed":"Permit2 approval failed","Please enter a valid slippage %":"Proszę podać poprawny % poślizgu","Powered by the Uniswap protocol":"Obsługiwany przez protokół Uniswap","Price impact":"Wpływ na cenę","Price updated":"Zaktualizowano cenę","Reload":"Reload","Reload the page":"Odśwież stronę","Request rejected":"Request rejected","Review swap":"Przejrzyj zamianę","Search by token name or address":"Szukaj według nazwy tokena lub adresu","Select token":"Select token","Show less":"Show less","Show more":"Show more","Something went wrong":"Something went wrong","Sorry, an error occured while processing your request. Please try again or contact support.":"Sorry, an error occured while processing your request. Please try again or contact support.","Success":"Sukces","Swap":"Zamień","Swap failed: {0}":["Zamiana nie powiodła się: ",["0"]],"Switch network":"Przełącz sieć","Switch network in your wallet":"Przełącz sieć w portfelu","Switching network":"Przełączanie sieci","Test Title":"Test Title","The Uniswap invariant x*y=k was not satisfied by the swap. This usually means one of the tokens you are swapping incorporates custom behavior on transfer.":"Niezmiennik Uniswap x * y = k nie został spełniony przez zamianę. Zwykle oznacza to, że jeden z wymienianych tokenów ma niestandardowe zachowanie podczas transferu.","The amount you expect to receive at the current market price. You may receive less or more if the market price changes while your transaction is pending.":"The amount you expect to receive at the current market price. You may receive less or more if the market price changes while your transaction is pending.","The estimated difference between the USD values of input and output amounts.":"The estimated difference between the USD values of input and output amounts.","The fee paid to miners to process your transaction. This must be paid in ETH.":"The fee paid to miners to process your transaction. This must be paid in ETH.","The impact your trade has on the market price of this pool.":"The impact your trade has on the market price of this pool.","The input token cannot be transferred. There may be an issue with the input token.":"Nie można przenieść tokena wejściowego. Być może wystąpił problem z tokenem wejściowym.","The network is confirming your Permit2 approval before you can swap.":"The network is confirming your Permit2 approval before you can swap.","The output token cannot be transferred. There may be an issue with the output token.":"Nie można przenieść tokenu wyjściowego. Może wystąpić problem z tokenem wyjściowym.","The output token cannot be transferred. There may be an issue with the output token. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Nie można przenieść tokena wyjściowego. Może występować problem z tokenem wyjściowym. Uwaga: opłata za transfer i rebase tokeny są niezgodne z Uniswap V3.","There will be a large difference between your input and output values due to current liquidity.":"There will be a large difference between your input and output values due to current liquidity.","This error was prompted by denying a request in your wallet.":"This error was prompted by denying a request in your wallet.","This transaction could not be sent because the deadline has passed. Please check that your transaction deadline is not too low.":"This transaction could not be sent because the deadline has passed. Please check that your transaction deadline is not too low.","This transaction will not succeed due to price movement. Try increasing your slippage tolerance. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Ta transakcja nie powiedzie się z powodu ruchu cen. Spróbuj zwiększyć swoją tolerancję na poślizg. Uwaga: opłata za transfer i rebase tokeny są niezgodne z Uniswap V3.","This transaction will not succeed either due to price movement or fee on transfer. Try increasing your slippage tolerance.":"Ta transakcja nie powiedzie się ze względu na ruch cen lub opłatę za transfer. Spróbuj zwiększyć tolerancję na poślizg.","This transaction will result in a":"This transaction will result in a","Transaction deadline":"Termin transakcji","Transaction rejected":"Transakcja odrzucona","Transaction submitted":"Transakcja przesłana","Try again":"Try again","Try increasing your slippage tolerance.<0/>NOTE: Fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Spróbuj zwiększyć swoją tolerancję na poślizg.<0/>UWAGA: Opłata za transfer i tokeny rebase są niezgodne z Uniswap V3.","Unexpected error. Could not estimate gas for the swap.":"Niespodziewany błąd. Nie udało się oszacować gazu do wymiany.","Unexpected issue with estimating the gas. Please try again.":"Nieoczekiwany problem z szacowaniem gazu. Proszę spróbuj ponownie.","Use the Uniswap Labs API to get faster quotes.":"Use the Uniswap Labs API to get faster quotes.","View on Etherscan":"Zobacz na Etherscan","Wallet disconnected":"Wallet disconnected","Warning":"Ostrzeżenie","You pay":"You pay","You receive":"You receive","Your swap failed.":"Your swap failed.","Your swap was modified through your wallet. If this was a mistake, please cancel immediately or risk losing your funds.":"Your swap was modified through your wallet. If this was a mistake, please cancel immediately or risk losing your funds.","Your transaction will revert if it has been pending for longer than this period of time.":"Twoja transakcja zostanie cofnięta, jeśli była w toku dłużej niż ten okres.","Your transaction will revert if the price changes unfavorably by more than this percentage.":"Twoja transakcja zostanie przywrócona, jeśli cena zmieni się niekorzystnie o więcej niż ten procent.","minutes":"minutes","price impact on the market price of this pool. Do you wish to continue?":"price impact on the market price of this pool. Do you wish to continue?","{0} approval failed":[["0"]," approval failed"],"{0} {1}":[["0"]," ",["1"]],"{0}. Try increasing your slippage tolerance.\nNote: fee-on-transfer and rebase tokens are incompatible with Uniswap V3.":[["0"],". Try increasing your slippage tolerance.\nNote: fee-on-transfer and rebase tokens are incompatible with Uniswap V3."],"{caption}":[["caption"]],"{integrator} fee":[["integrator"]," opłat"],"{symbol} permit allowance failed: {0}":[["symbol"]," permit allowance failed: ",["0"]],"{symbol} token allowance failed: {0}":[["symbol"]," token allowance failed: ",["0"]],"{title}":[["title"]]}};

